import React from 'react';
import Map from 'react-map-gl';


function App() {
  const MAPBOX_TOKEN="pk.eyJ1IjoicmFqZ3VwdGE3NyIsImEiOiJjbDJxY29sMWYwZmYzM2dwYzl1NTZkcjlzIn0.rRfrsqrcAJlyrWYYJB9EPA";
  return (
    <div className='App'>
      <Map
        mapboxApiAccessToken={MAPBOX_TOKEN}
        width={400}
        height={400}
        latitude={37.7577}
        longitude={-122.4376}
        zoom={8}

      />
    </div>
  );
}
export default App;
